import{_ as e,a}from"./chunks/psk-cm8jl65-cc5-02.Cv-GlyFY.js";import{_ as r,c as t,o,ab as s}from"./chunks/framework.CUflZczI.js";const S=JSON.parse('{"title":"Lanbao PSK-CM8JL65-CC5 ІЧ-датчик вимірювання відстані ToF","description":"","frontmatter":{},"headers":[],"relativePath":"uk/sensor/cm8jl65_ir_distance_sensor.md","filePath":"uk/sensor/cm8jl65_ir_distance_sensor.md"}'),n={name:"uk/sensor/cm8jl65_ir_distance_sensor.md"},i=s('<h1 id="lanbao-psk-cm8jl65-cc5-іч-датчик-вимірювання-відстані-tof" tabindex="-1">Lanbao PSK-CM8JL65-CC5 ІЧ-датчик вимірювання відстані ToF <a class="header-anchor" href="#lanbao-psk-cm8jl65-cc5-іч-датчик-вимірювання-відстані-tof" aria-label="Permalink to &quot;Lanbao PSK-CM8JL65-CC5 ІЧ-датчик вимірювання відстані ToF&quot;">​</a></h1><p>Датчик відстані ІЧ <a href="https://www.seeedstudio.com/PSK-CM8JL65-CC5-Infrared-Distance-Measuring-Sensor-p-4028.html" target="_blank" rel="noreferrer">Lanbao PSK-CM8JL65-CC5</a> є дуже малий з діапазоном від 0,17 м до 8 м і роздільною здатністю у міліметрах. Це повинно бути підключено до шини UART/серійного порту.</p><ul><li>Розміри: 38 мм х 18 мм х 7 мм</li><li>Вага: ≤10g</li></ul><p><img src="'+e+'" alt="Датчик відстані PSK-CM8JL65-CC5 ToF IR - Hero image"></p><h2 id="налаштування-обладнання" tabindex="-1">Налаштування обладнання <a class="header-anchor" href="#налаштування-обладнання" aria-label="Permalink to &quot;Налаштування обладнання&quot;">​</a></h2><p>PSK-CM8JL65-CC5 може бути підключений до будь-якого не використаного <em>серійного порту</em>, наприклад: TELEM2, TELEM3, GPS2 тощо.</p><p>Виводи позначені знизу сенсора:</p><p><img src="'+a+'" alt="PSK-CM8JL65-CC5 ToF IR Distance Sensor - Pinout connections"></p><h2 id="налаштування-параметрів" tabindex="-1">Налаштування параметрів <a class="header-anchor" href="#налаштування-параметрів" aria-label="Permalink to &quot;Налаштування параметрів&quot;">​</a></h2><p><a href="./../peripherals/serial_configuration.html">Налаштуйте послідовний порт</a>, на якому буде працювати лідар, використовуючи <a href="./../advanced_config/parameter_reference.html#SENS_CM8JL65_CFG">SENS_CM8JL65_CFG</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Якщо параметр конфігурації недоступний у <em>QGroundControl</em>, можливо, вам знадобиться <a href="./../peripherals/serial_configuration.html#parameter_not_in_firmware">додати драйвер до мікропрограми</a>:</p><div class="language-plain vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">plain</span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>distance_sensor/cm8jl65</span></span></code></pre></div></div><p>Для використання датчика для <em>попередження про зіткнення</em> вам також потрібно встановити параметри <a href="./../advanced_config/parameter_reference.html#SENS_CM8JL65_R_0">SENS_CM8JL65_R_0</a> та <a href="./../advanced_config/parameter_reference.html#CP_DIST">CP_DIST</a>. Для отримання додаткової інформації дивіться: <a href="./../computer_vision/collision_prevention.html#rangefinder">Запобігання зіткненням</a>.</p>',12),c=[i];function l(_,p,m,d,h,C){return o(),t("div",null,c)}const b=r(n,[["render",l]]);export{S as __pageData,b as default};
